<script>
    document.getElementById('linked').addEventListener('submit', function(event) {
        event.preventDefault();

        const originalLink = document.getElementById('original_link').value;
        const token = document.querySelector('meta[name="csrf-token"]').getAttribute('content');


        fetch('/create-link', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
                'X-CSRF-TOKEN': token
            },
            body: JSON.stringify({ original_link: originalLink })
        })
        .then(response => response.json())
        .then(data => {
            document.getElementById('result').innerHTML = "http://shortslash.com/" + data.data;
            console.log('Success:', data);
            // Handle success (e.g., display a success message, clear the form, etc.)
        })
        .catch(error => {
            console.error('Error:', error);
            console.log(token);
            // Handle error (e.g., display an error message)
        });
    });
</script>

